function DashboardCard({ title, onClick }) {
  return (
    <div className="card" style={{minWidth:220,padding:24,background:'#fff',borderRadius:12,boxShadow:'0 2px 8px rgba(51,103,59,0.08)',textAlign:'center'}}>
      <h2 style={{marginBottom:12}}>{title}</h2>
      <button onClick={onClick} style={{textDecoration:'none',color:'#388e3c',fontWeight:600,background:'none',border:'none',cursor:'pointer',fontSize:'1rem',marginTop:8}}>Go to {title}</button>
    </div>
  );
}

export default DashboardCard;
